import React from 'react';
import data from "../data";
import img from "./photo.jpeg";
function Card() {
  return (
      <div className="Card">
         <img src={img} alt="noimage"></img>
         <p className='name'>{data[0].name}></p>
         <img src={data[0].price}></img>
      </div>
  )
}

export default Card
